import React from 'react'

const AddTaskListForm = ({taskListForm, }) => {

  const formSubmit = e =>{
    e.preventDefault();
    taskListForm = false;
  }
  const closeHandler = e => {
    taskListForm = false
  }

  return(
    <div className="add-task-list-form">
      <form>
      {taskListForm.toLocaleString()}
        <label>AddTaskListForm</label>
        <input></input>
        <button className="add-column-btn" 
                type="submit" 
                onClick={formSubmit}>Add</button>
        <button className="close" 
                type="button" 
                onClick={closeHandler}>
          <i className="fas fa-plus"></i>
        </button>
      </form>
    </div>
  )
}


export default AddTaskListForm;
